private Image<CachedLayer> afterCachedLayersSteps() throws ExecutionException, LayerPropertyNotFoundException {
  try (Timer ignored=new Timer(buildConfiguration.getBuildLogger(),DESCRIPTION)){
    Image.Builder<CachedLayer> imageBuilder=Image.builder();
    for (    PullAndCacheBaseImageLayerStep pullAndCacheBaseImageLayerStep : NonBlockingSteps.get(pullAndCacheBaseImageLayersStep)) {
      imageBuilder.addLayer(NonBlockingSteps.get(pullAndCacheBaseImageLayerStep));
    }
    for (    BuildAndCacheApplicationLayerStep buildAndCacheApplicationLayerStep : buildAndCacheApplicationLayerSteps) {
      imageBuilder.addLayer(NonBlockingSteps.get(buildAndCacheApplicationLayerStep));
    }
    imageBuilder.addEnvironment(NonBlockingSteps.get(pullBaseImageStep).getBaseImage().getEnvironment());
    ContainerConfiguration buildConfiguration.getContainerConfiguration()=buildConfiguration.getContainerConfiguration();
    if (buildConfiguration.getContainerConfiguration() != null) {
      imageBuilder.addEnvironment(buildConfiguration.getContainerConfiguration().getEnvironmentMap());
      imageBuilder.setCreated(buildConfiguration.getContainerConfiguration().getCreationTime());
      imageBuilder.setEntrypoint(buildConfiguration.getContainerConfiguration().getEntrypoint());
      imageBuilder.setJavaArguments(buildConfiguration.getContainerConfiguration().getProgramArguments());
      imageBuilder.setExposedPorts(buildConfiguration.getContainerConfiguration().getExposedPorts());
    }
    return imageBuilder.build();
  }
 }
